Common.LongDescription.Common.Text:
Located in the popular Magill Road precinct, and just 5 minutes from the CBD  is 196 Magill Road, Norwood. 

Fully self contained, the tenancy is afforded with a functional layout that can be readily used or adapted to suit various businesses. 

Features include: 
- 299sqm of open plan space with 8 offices, board room and meeting rooms;
- Kitchenette & utility areas;
- 4 on-site carparks plus easy on-street parking within close proximity;
- Data cabling in-situ;
- Excellent signage opportunities with great exposure to daily road users passing through Norwood.

Lease Term: Negotiable 
Availability: Immediate
Rent Reviews: Negotiable
